    false,nt"url": null,nt"notes": "EM300 and EM3002D multibeam Data were collected
    from July 31 - August 19 2006 aboard NOAA Ship Hi'ialakai at Hawaii Island, Maui
    Island, Niihau Island, Lanai Island in the Main Hawaiian Islands, during cruise
    HI-06-10. These multibeam data were collected using SAIC ISS-2000 software in the
    Generic Sensor Format and processed using SABER editing software. Surface sound
    velocity values were supplied by a Seabird SBE-45 MicroTSG and a SBE-38 remote temperature
    probe. Sound velocity corrections from a Seabird 911 CTD sensor and motion corrections
    from a POS-MV vertical reference were applied to the data in real time. Predicted
    tides were applied to the data in real time. Horizontal accuracy is 20 m (differential
    GPS correctors applied), vertical accuracy is depth dependent (~1% of water depth),
    WGS84 datum. These data are not to be used for navigation. Depths mapped ange from
    ~20 to 3000 m.",nt"owner_org": "e811f0b4-451f-4896-9e8f-fc6802837819",nt"extras":
